import React from "react";
import logo from './logo.svg';
import './App.css';

class something extends React.Component(){
  render(){
    return (
      <h1></h1>
    )
  }
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a> 

      </header>
    </div>
  );
}

export default App;
